class ArticleListView extends React.Component{
    state = {
        articles : []
    }
    componentDidMount(){
        axios.get('http://127.0.0.1:8000/api/')
        .then(res => {
            this.setState({
                articles: res.data
            })
            console.log(res.data)
        })
    }
    render(){
        return(
            <Articles data={this.state.articles}></Articles>
        )
    }
}
export default ArticleList
